import LinkEditor from "../LinkEditor/LinkEditor";

const LinkEditorCard = ({ links }) => {
  return (
    <>
      <div>Add Links</div>
      {links.map((link) => (
        <LinkEditor link={link} />
      ))}

      <button>Add New Link</button>
    </>
  );
};

export default LinkEditorCard;
